// RT Calls Class
// v2.0 12th Dec 2017: Added images to class as URI data; added CSS to class.
// v1.1 27th June 2017
// Jon Williams

function RT (args) {



  // icon images
  this.planeImg = 'data:image/png;base64,';

  this.towerImg = 'data:image/png;base64,';

  this.groundImg = 'data:image/png;base64,';

  this.jetImg = 'data:image/png;base64,';

  this.vanImg = 'data:image/png;base64,';

  this.tugImg = 'data:image/png;base64,';

  this.fireImg = 'data:image/png;base64,';

  this.tankerImg = 'data:image/png;base64,';

  this.cessnaImg = 'data:image/png;base64,';


  var cssWritten;
  var args = args || {};
  this.type = args.type || 'plane';
	this.id = args.id || 'rt_p1';
	this.audio = args.audio || this.id;
	this.text = args.text || '';
	//this.image = args.image || 'rt_' + this.type + '_icon.png';
  //this.imageDir = args.imageDir || '..//img//rt//';
  this.textColor = args.textColor || '#005EB8';
	this.onstart = args.onstart || '';
	this.onended = args.onended || '';
	this.css = args.css || '';
  this.audioCss = args.audioCss || '';
  this.audioControls = (typeof args.audioControls === 'undefined') ? true : args.audioControls;
  this.audioId = args.audioId || 'rt-audio';


  switch (this.type) {
    case 'tower': this.image = this.towerImg; this.textColor = '#00C389'; break;
    case 'ground': this.image = this.groundImg; this.textColor = '#772583'; break;
    case 'jet': this.image = this.jetImg; break;
    case 'van': this.image = this.vanImg; this.textColor = '#772583'; break;
    case 'tug': this.image = this.tugImg; this.textColor = '#772583'; break;
    case 'fire': this.image = this.fireImg; this.textColor = '#772583'; break;
    case 'tanker': this.image = this.tankerImg; this.textColor = '#772583'; break;
    case 'cessna': this.image = this.cessnaImg; break;
    default:
      this.image = this.planeImg;


  }

  if (this.type != "plane" && this.type != "jet" && this.type != "cessna" && !args.position) {
    this.position = 'right';
  } else {
    this.position = args.position || 'left';
  }

  //do we need to add the audio object??
	if (!document.getElementById(this.audioId)) {
    var html = '<audio id="' + this.audioId + '" class="rt-audio" style="' + this.audioCss + '"';
    if (this.audioControls) { html += ' controls '; }
    html += '><source src="" type="audio/mp3"></audio>';
		document.write(html);
	}

  this.getNumber = function () { return $('.rt-call').length + 1; }

	var html = '<div class="rt-call" id="' + this.id + '-container">';
	html += '<div class="rt-call-number">' + this.getNumber() + '</div>';
	//html += '<div class="rt-call-icon rt-call-icon-' + this.position + '"><img src="' + this.imageDir + this.image + '" alt="icon" /></div>';
  html += '<div class="rt-call-icon rt-call-icon-' + this.position + '"><img src="' + this.image + '" alt="icon" /></div>';
	html += '<div id="' + this.id + '" class="rt-call-text rt-call-text-' + this.position + '" style="color:' + this.textColor + ';' + this.css + '"></div>';
	html += '</div>';

  if ($('#RT-style').length == 0) {
    html += '<style id="RT-style">';
    html += '.rt-audio { margin-bottom: 20px; width: 100%; }';
    html += '.rt-container { max-width: 800px; margin: auto; }';
    html += '.rt-call { border: 1px solid #cccccc; position: relative; margin-bottom: 20px; background: #e2e2e2; cursor: pointer; min-height: 84px; }';
    html += '.rt-call-number { border: 1px solid #cccccc; background: #ffffff; font-size: 12px; position: absolute; left: 0px; top: 0px;   	font-size: 14px; font-weight: bold; padding: 1px; min-width: 10px; text-align: center; color: #999999; z-index: 9999; }';
    html += '.rt-call-icon { border: 1px solid #cccccc; padding: 0px; margin: 0px; overflow: hidden; height: 80px; position: absolute; }';
    html += '.rt-call-icon-right { right: 0; }';
    html += '.rt-call-text { padding: 10px; width: 100%; box-sizing: border-box; font-weight: bold; }';
    html += '.rt-call-text-left { padding-left: 180px; }';
    html += '.rt-call-text-right { padding-right: 180px; margin-left: 10px; text-align: right; }';
    html += '</style>';
  }

	document.write(html);

  //add event listeners
  var my_this = this;
  var container = document.getElementById(this.id + '-container');
  container.addEventListener('click', function (e) { my_this.play(); });



  this.play = function ()
  {

    var my_this = this;
  	var a = document.getElementById(this.audioId);

  	//run onplay?
  	a.onplay = function () { eval(my_this.onstart); }

  	//add onended?
  	a.onended = function () { eval(my_this.onended); }

  	//load and play audio
  	a.pause();
  	a.src = this.audio + '.mp3';
  	a.play();

  	$('#' + this.id).html(this.text);

  }







}
